package com.hackerrank.recursion;

import java.util.*;

/**
 * Created by Rajesh on 2/22/2018.
 * https://www.hackerrank.com/challenges/arithmetic-expressions/problem
 */

public class ExpressionWithValue {

    static  Map<Integer, Set<Long>> cache = new HashMap<>();

    static String arithmeticExpressions(int[] arr) {
        System.out.println("Start");
        String [] expression = new String[2*arr.length-1];
        for(int i=0; i<arr.length; ++i){
            expression[0] = ""+ arr[i];
            boolean stop = recurse(arr, expression, arr.length, (long)arr[i], 0);
            if(stop){
                StringBuilder buff = new StringBuilder();
                for(String a: expression){
                    buff.append(a);
                }
                return buff.toString();
            }
        }
        return null;
    }

    static boolean recurse(int[] arr, String [] expre, int len, long currVal, int currIdx){
        if(currVal %101 == 0 ){
            if(currIdx < 2*(len-1)){
                for(int i = currIdx/2 + 1 ; i < len; ++i){
                        expre[++currIdx] = "*";
                        expre[++currIdx] = ""+arr[i];
                }
            }
            return true;
        }
        if(currIdx == 2*(len-1)){
            if(currVal % 101 ==0) {
                return true;
            }
            else{
                return false;
            }

        }

        int i = currIdx/2 + 1;
        if(cache.containsKey(i) && cache.get(i).contains(currVal)) return false;
        expre[currIdx+2] = ""+arr[i];
        expre[currIdx+1] = "+";
        boolean ret = false;
        long newCurrVal = (currVal + arr[i]) % 101;
        ret = recurse(arr, expre, len, newCurrVal, currIdx+2);
        if(ret) return  ret;
        expre[currIdx+1] = "-";
        newCurrVal = (currVal - arr[i]) % 101;
        if(newCurrVal < 0){
            newCurrVal = (newCurrVal + 101)%101;
        }
        ret = recurse(arr, expre, len, newCurrVal , currIdx+2);
        if(ret) return  ret;
        expre[currIdx+1] = "*";
        newCurrVal = (currVal * arr[i]) % 101;
        ret = recurse(arr, expre, len, newCurrVal, currIdx+2);
        if(ret) return  ret;

        {
            Set<Long> cacheAtIdx = cache.get(i);
            if(cacheAtIdx == null){
                cacheAtIdx = new HashSet<>();
                cache.put(i, cacheAtIdx);
            }
            cacheAtIdx.add(currVal);
        }
        return false;
    }

    public static void main2(String[] args) {
        Scanner in = new Scanner(System.in);
        int n = in.nextInt();
        int[] arr = new int[n];
        for(int arr_i = 0; arr_i < n; arr_i++){
            arr[arr_i] = in.nextInt();
        }
        String result = arithmeticExpressions(arr);
        System.out.println(result);
        in.close();
    }
    public static void main(String[] args) {
        Scanner in = new Scanner(System.in);
        String expr = in.next();
        char [] arr = expr.toCharArray();

        String[] split = expr.split("[\\*+-]");
        for(String s: split){
            System.out.println(s);
        }
        long val = Integer.parseInt(split[0]);
        int nextIdx = 1;
        for(char c: arr){
            switch (c){
                case '+':
                    val += Long.parseLong(split[nextIdx++]);
                    val %= 101;
                    System.out.println(val);
                    break;
                case '-':
                    val -= Long.parseLong(split[nextIdx++]);
                    val %= 101;
                    if(val < 0) {
                        val = (val+101)%101;
                    }
                    System.out.println(val);
                    break;
                case '*':
                    val *= Long.parseLong(split[nextIdx++]);
                    val %= 101;
                    System.out.println(val);
                    break;
                default:
                    break;
            }
        }
        System.out.println(val);
        in.close();
    }
}

